import React from 'react'
import './Checkbox.scss'

function Checkbox(props) {
    return (
        <div>
            <input 
                className='checkbox-custom' 
                type="checkbox" 
                id={this.props.id}
            />
            <label 
                for={this.props.id} 
            >{this.props.task}</label>
        </div>
    )
}

export default Checkbox
